import { Todo } from "../../components/planPage/types/types.ts"
import { instanse } from "../api.ts"


export const Todos = {
    getTodos() {
        return instanse.get('/todos')
    },
    setTodo(todo:Todo) {
        return instanse.post('/todos',todo)
    },
    setTodo(todo:Todo) {
        return instanse.post('/todos',todo)
    },
}
